  ABOUT_TEXT__ABOUT_TEXT: '### Ancient Empire: Strike Back',
  INSTRUCTION__01: "'Ancient Empire: Strike Back' - это захватывающая стратегия, которая позволяет вам управлять Королем Галамаром и его братом Валадорном в попытках защитить их королевство от зла.",
  INSTRUCTION__02: 'Далее последуют инструкции, подсказки и советы о том, как играть, которые также будут появляться в игре.',
  INSTRUCTION__03: 'Красные квадраты помечают область перемещения войск. Границы воина определяется его типом и местностью, на которой он стоит.',
  INSTRUCTION__04: 'Разные типы местности влияют на способности войск к передвижению, атаке и защите. Например, горы добавляют боевым единицам очки защиты, но замедляют скорость передвижения. Когда вы двигаете курсор через такие места, их особенности появляются внизу экрана.',
  INSTRUCTION__05: 'Когда воин завершит движение, он сменит цвет на серый. Она означает, что воин не может быть использован снова до следующего вашего хода.',
  INSTRUCTION__06: "Вы можете перемещать война только один раз за ход. Когда вы закончите движение всех ваших войск, то выберите 'конец хода'.",
  INSTRUCTION__07: 'Войны становятся более сильными, получая опыт в битвах.',
  INSTRUCTION__08: 'Вы можете увидеть пределы атаки любого война нажатием на него.',
  INSTRUCTION__09: "Чтобы атаковать вражеского бойца, сдвиньте вашего бойца в пределы атаки и выберите 'атака'. Если в пределах атаки находятся несколько врагов, выберите, какого противника атаковать. Успех атаки определяется характеристиками бойцов и местностью.",
  INSTRUCTION__10: 'Только командир может занять замок. Как только замок оккупирован, вы можете покупать новые войска за золото. Командиру не обязательно оставаться в замке, чтобы покупать войска.',
  INSTRUCTION__11: "Вы можете занимать здания, переместив Солдата или Командира на него и выбрав 'занять'. Как только здание будет занято, оно сменит цвет. Если здание повреждено, вам придется отремонтировать его, перед тем как занять.",
  INSTRUCTION__12: 'Как только здание будет занято, оно начнет приносить золото. Чем больше зданий вы займете, тем больше заработаете.',
  INSTRUCTION__13: 'Войска могут лечиться в занятых зданиях. Чем больше боец находится в здании, тем больше жизни восстановится.',
  INSTRUCTION__14: 'Если Командир погибнет в битве, его можно будет оживить в замке.',
  INSTRUCTION__15: 'Водные Элементалы - земноводные, что увеличивает им перемещение, атаку и защиту, когда они в воде.',
  INSTRUCTION__16: 'Атака Жутких Волков ядовита. Отравленная единица становится медленной и вялой в следующем ходе.',
  INSTRUCTION__17: "Ведьма имеет силу поднимать скелетов-воинов из могил павших солдат. После поражения бойца на его месте появится надгробие. Переместите Ведьму к надгробию и выберите 'поднять'.",
  INSTRUCTION__18: 'Используйте Виспов, чтобы обеспечить ближайшие дружественные войска аурой, которая усиливает их атаку.',
  INSTRUCTION__19: 'Катапульта может уничтожать вражеские города, что помогает прервать поток золота.',
  INSTRUCTION__20: 'Держите ваших Драконов подальше от вражеских стрелков, потому что они уязвимы перед стрелами!',
