  MAP_NAME__AE2_MISSION__STORY_1_1: "![](".concat(ae2_image/* ae2StoryImage.story1part1.src */.t.story1part1.src, ")\n\n\u041F\u043E\u0441\u043B\u0435 \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043D\u0438\u044F \u0432\u043E\u0439\u043D\u044B \u043F\u0440\u043E\u0442\u0438\u0432 \u0441\u0438\u043B \u0442\u044C\u043C\u044B, \u0431\u0440\u0430\u0442\u044C\u044F \u0413\u0430\u043B\u0430\u043C\u0430\u0440 \u0438 \u0412\u0430\u043B\u0430\u0434\u043E\u0440\u043D \u0432\u043E\u0441\u0441\u043E\u0435\u0434\u0438\u043D\u0438\u043B\u0438\u0441\u044C \u0432 \u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u0438 \u043A\u043E\u0440\u043E\u043B\u0435\u0432\u0441\u0442\u0432\u0430 \u0422\u043E\u0440\u0438\u043D. \u041A\u043E\u0440\u043E\u043B\u0435\u0432\u0441\u0442\u0432\u043E \u043C\u0435\u0434\u043B\u0435\u043D\u043D\u043E \u0432\u043E\u0437\u0432\u0440\u0430\u0449\u0430\u043B\u043E\u0441\u044C \u043A \u043C\u0438\u0440\u043D\u043E\u0439 \u0436\u0438\u0437\u043D\u0438, \u0437\u0430\u0449\u0438\u0449\u0435\u043D\u043D\u043E\u0435 \u0442\u0440\u0435\u043C\u044F \u0430\u043D\u0442\u0438\u0447\u043D\u044B\u043C\u0438 \u043A\u0440\u0438\u0441\u0442\u0430\u043B\u043B\u0430\u043C\u0438, \u0437\u0430\u0449\u0438\u0449\u0435\u043D\u043D\u044B\u043C\u0438 \u0432 \u0445\u0440\u0430\u043C\u0430\u0445 \u041E\u0442\u0432\u0430\u0433\u0438, \u041C\u0443\u0434\u0440\u043E\u0441\u0442\u0438 \u0438 \u0416\u0438\u0437\u043D\u0438, \u043A\u043E\u0433\u0434\u0430 \u0434\u043E\u0441\u0442\u0438\u0433\u043B\u0438 \u0434\u0432\u043E\u0440\u0446\u0430 \u0441\u043B\u0443\u0445\u0438 \u043E \u0441\u0445\u0432\u0430\u0442\u043A\u0430\u0445 \u043D\u0430 \u0421\u0435\u0432\u0435\u0440\u0435...\n***"),
  MAP_NAME__AE2_MISSION__STORY_1_2: "![](".concat(ae2_image/* ae2StoryImage.story1part2.src */.t.story1part2.src, ")\n\n\u0418 \u0442\u0440\u0438 \u0431\u044B\u043B\u043E \u0438\u0445 \u0447\u0438\u0441\u043B\u043E\u043C, \u0442\u0440\u0438 \u0434\u043B\u044F \u0437\u0430\u0449\u0438\u0442\u044B, \u0442\u0440\u0438 \u0434\u043B\u044F \u0443\u043D\u0438\u0447\u0442\u043E\u0436\u0435\u043D\u0438\u044F. \u0421\u0436\u0430\u043B\u044C\u0441\u044F \u043D\u0430\u0434 \u0438\u0445 \u0441\u0438\u043B\u043E\u0439, \u0441\u0436\u0430\u043B\u044C\u0441\u044F \u043D\u0430\u0434 \u043D\u0430\u0448\u0438\u043C\u0438 \u0434\u0443\u0448\u0430\u043C\u0438, \u043F\u0443\u0441\u0442\u044C \u041E\u043D \u0441\u043F\u0443\u0441\u0442\u0438\u0442 \u043D\u0435\u0431\u0435\u0441\u043D\u044B\u0435 \u043E\u0433\u043D\u0438 \u043D\u0430 \u043D\u0430\u0448 \u043C\u0438\u0440.\n\n[\u0421\u0442\u0438\u0445 3:7 \u0438\u0437  \u041F\u0440\u0435\u0434\u0441\u043A\u0430\u0437\u0430\u043D\u0438\u0439 \u041A\u0440\u0438\u0441\u0442\u0430\u043B\u043B\u043E\u0432, \u0430\u0432\u0442\u043E\u0440 \u043D\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u0435\u043D, \u0431\u044B\u043B \u043F\u0435\u0440\u0435\u0432\u0435\u0434\u0435\u043D \u0438\u0437 \u0435\u0434\u0438\u043D\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0433\u043E \u0443\u0446\u0435\u043B\u0435\u0432\u0448\u0435\u0433\u043E \u043C\u0430\u043D\u0443\u0441\u043A\u0440\u0438\u043F\u0442\u0430 \u0412\u0440\u0435\u043C\u0435\u043D \u0422\u044C\u043C\u044B]\n***"),
  MAP_NAME__AE2_MISSION__STORY_1_3: "![](".concat(ae2_image/* ae2StoryImage.story1part3.src */.t.story1part3.src, ")\n\n\u041F\u043E\u0441\u043B\u0430\u043D\u043D\u0438\u043A \u0438\u0437 \u0425\u0440\u0430\u043C\u0430 \u041E\u0442\u0432\u0430\u0433\u0438 \u043F\u0440\u0438\u0431\u044B\u043B \u043A \u0432\u043E\u0440\u043E\u0442\u0430\u043C \u0437\u0430\u043C\u043A\u0430, \u0441 \u043C\u043E\u043B\u044C\u0431\u043E\u0439 \u043E \u043F\u043E\u0434\u0434\u0435\u0440\u0436\u043A\u0435 \u041A\u043E\u0440\u043E\u043B\u044F - \u0425\u0440\u0430\u043C \u043F\u0430\u043B \u043F\u043E\u0434 \u043D\u0430\u0442\u0438\u0441\u043A\u043E\u043C \u0437\u0432\u0435\u0440\u0441\u043A\u0438\u0445 \u0430\u0442\u0430\u043A\u0443\u044E\u0449\u0438\u0445, \u0438 \u0434\u043E\u043B\u0436\u0435\u043D \u0431\u044B\u0442\u044C \u0437\u0430\u0449\u0438\u0449\u0435\u043D..."),
  MAP_NAME__AE2_MISSION__STORY_4_1: "![](".concat(ae2_image/* ae2StoryImage.story4part1.src */.t.story4part1.src, ")\n\n\u0421 \u043F\u043E\u043C\u043E\u0449\u044C\u044E \u042D\u043B\u0435\u043C\u0435\u043D\u0442\u0430\u043B\u0435\u0439, \u041A\u043E\u0440\u043E\u043B\u044C \u0413\u0430\u043B\u0430\u043C\u0430\u0440 \u0432 \u043A\u043E\u043D\u0446\u0435 \u043A\u043E\u043D\u0446\u043E\u0432 \u0434\u043E\u0441\u0442\u0438\u0433 \u0425\u0440\u0430\u043C\u0430 \u0416\u0438\u0437\u043D\u0438, \u0432 \u043E\u0434\u043D\u043E\u043C \u0448\u0430\u0433\u0435 \u043E\u0442 \u0432\u0440\u0430\u0433\u043E\u0432..."),
  MAP_NAME__AE2_MISSION__STORY_8_1: "![](".concat(ae2_image/* ae2StoryImage.story8part1.src */.t.story8part1.src, ")\n\n\u0413\u0430\u043B\u0430\u043C\u0430\u0440 \u0438 \u0412\u0430\u043B\u0430\u0434\u043E\u0440\u043D \u043F\u0440\u043E\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u043B\u0438 \u043F\u043E \u043F\u0443\u0442\u0438 \u0440\u0430\u0437\u0440\u0443\u0448\u0435\u043D\u0438\u0439, \u043E\u0441\u0442\u0430\u0432\u043B\u0435\u043D\u043D\u044B\u0445 \u0434\u0440\u0430\u043A\u043E\u043D\u043E\u043C \u0438 \u043E\u0431\u043D\u0430\u0440\u0443\u0436\u0438\u043B\u0438 \u0440\u0443\u0438\u043D\u044B \u0410\u043D\u0442\u0438\u0447\u043D\u043E\u0439 \u0426\u0438\u0442\u0430\u0434\u0435\u043B\u0438...\n***"),
  MAP_NAME__AE2_MISSION__STORY_8_2: "![](".concat(ae2_image/* ae2StoryImage.story8part2.src */.t.story8part2.src, ")\n\n\u0418 \u0417\u0435\u043C\u043B\u044F \u0437\u0430\u0434\u0440\u043E\u0436\u0438\u0442, \u0438 \u043D\u0435\u0431\u0435\u0441\u0430 \u0437\u0430\u043F\u043B\u0430\u0447\u0443\u0442. \u0417\u0430 \u041D\u0435\u0433\u043E, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0440\u0430\u0437\u0440\u0443\u0448\u0438\u0442 \u0440\u0430\u0437\u0440\u0443\u0448\u0438\u0442\u0435\u043B\u044F, \u0437\u0430 \u041D\u0435\u0433\u043E, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0437\u0430\u0431\u0435\u0440\u0435\u0442 \u0431\u0435\u0440\u0443\u0449\u0435\u0433\u043E. \u0418 \u043D\u043E\u0432\u0430\u044F \u044D\u0440\u0430, \u0441\u0432\u043E\u0431\u043E\u0434\u043D\u0430\u044F \u043E\u0442 \u0437\u043B\u0430 \u0438 \u0442\u044C\u043C\u044B \u043D\u0430\u0441\u0442\u0443\u043F\u0438\u0442.\n\n[\u041F\u043E\u0441\u043B\u0435\u0434\u043D\u0438\u0439 \u0441\u0442\u0438\u0445 \u0438\u0437  \u041F\u0440\u0435\u0434\u0441\u043A\u0430\u0437\u0430\u043D\u0438\u0439 \u041A\u0440\u0438\u0441\u0442\u0430\u043B\u043B\u043E\u0432, \u0430\u0432\u0442\u043E\u0440 \u043D\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u0435\u043D, \u043D\u0438\u043A\u043E\u0433\u0434\u0430 \u043D\u0435 \u043F\u0435\u0440\u0435\u0432\u043E\u0434\u0438\u043B\u0441\u044F, \u0431\u044B\u043B \u043F\u043E\u0442\u0435\u0440\u044F\u043D \u0432\u043E \u0412\u0440\u0435\u043C\u0435\u043D\u0430 \u0422\u044C\u043C\u044B]"),
