  MAP_NAME__AE2_MISSION_1__BRIEFING_1_TAMPLIER: 'Помогите! Нас атакуют! Эти скелеты-налетчики украли Кристалл Отваги, который мы поклялись защищать!',
  MAP_NAME__AE2_MISSION_1__BRIEFING_2_GALAMAR: 'Капитан, мы должны остановить эту угрозу немедленно!',
  MAP_NAME__AE2_MISSION_1__BRIEFING_3_SOLDIER: 'Вперед, войска! Заставим этих налетчиков заплатить!',
  // trigger
  MAP_NAME__AE2_MISSION_1__BRIEFING_4_SOLDIER: 'Ещё атакующие!',
  MAP_NAME__AE2_MISSION_1__BRIEFING_5_GALAMAR: 'Там не налетчики! Они похожи на вражеские войска! Будьте осторожны, Капитан!',
  // end
  MAP_NAME__AE2_MISSION_1__BRIEFING_6_TAMPLIER: 'Благодарю, ваше Величество, вы должны помочь нам возвратить Кристалл как можно быстрее. Такая важная реликвия не должна попасть в плохие руки!',
  MAP_NAME__AE2_MISSION_1__BRIEFING_7_GALAMAR: 'Я в вашем распоряжении. Кто сможет проследить за Кристаллом?',
  MAP_NAME__AE2_MISSION_1__BRIEFING_8_TAMPLIER: 'Боюсь, эти злоумышленники могут быть связаны с еще большим злом. Было бы умно посоветоваться с Высшим Священником из Храма Мудрости. Он может знать больше об этом.',
  MAP_NAME__AE2_MISSION_1__BRIEFING_9_GALAMAR: 'Я пошлю брата Валадорна немедленно. Я возьму свои войска и буду преследовать атакующих.',
  // start
  MAP_NAME__AE2_MISSION_2__BRIEFING_1_VALADORN: 'Как это может быть? Храм Мудрости тоже атакован!',
  MAP_NAME__AE2_MISSION_2__BRIEFING_2_DEMON_LORD: 'Так, так... Валадорн, предполагаю? Приготовься к поражению!',
  MAP_NAME__AE2_MISSION_2__BRIEFING_3_SOLDIER: 'Сэр, часть вражеских сил отступает!',
